import "./App.scss";
import { BrowserRouter, Switch, Route, Link } from "react-router-dom";
import Hero from "./pages/Hero/Hero";
import Header from "./components/Header/Header";
import CustSignUp from "./pages/CustSignUp/CustSignUp";

function App() {
  return (
    <>
      <BrowserRouter>
        <Header />
        <Switch>
          <Hero />
          <CustSignUp />
        </Switch>
      </BrowserRouter>
    </>
  );
}

export default App;
